(function() {
  var styleData = 'data:text/css;base64,';
  
  function injectStyle() {
    var head = document.head;
    var link = document.createElement('link');
    link.type = 'text/css';
    link.rel = 'stylesheet';
    link.href = styleData;
    head.appendChild(link);
  }

  module.exports = injectStyle;
})();